import {
  Button,
  Popover,
  PopoverBody,
  PopoverHeader,
  UncontrolledPopover,
  CloseButton,
} from "reactstrap";
import Cart from "./cart";

export default function PopOver() {
  return (
    <div>
      <Button
        className=' mt-2'
        color='primary'
        id='popover644119284'
        type='button'>
        Popover on top
      </Button>
      <UncontrolledPopover
        placement='top'
        target='popover644119284'>
        <PopoverBody>
          <CloseButton />
          <Cart />
        </PopoverBody>
      </UncontrolledPopover>
    </div>
  );
}
